USE `waihui`;

/*Table structure for table `sport_user` */

DROP TABLE IF EXISTS `sport_user`;

CREATE TABLE `sport_user` (
  `id` varchar(36) NOT NULL COMMENT '主键，自增ID',
  `email` varchar(128) DEFAULT NULL COMMENT '登录注册时用的邮箱',
  `mobile` varchar(13) DEFAULT NULL COMMENT '登录注册时用的手机号码',
  `password` varchar(32) DEFAULT NULL,
  `nick_name` varchar(100) DEFAULT NULL COMMENT '别名',
  `cname` varchar(100) DEFAULT NULL COMMENT '中文名',
  `ename` varchar(100) DEFAULT NULL COMMENT '英文名',
  `gender` int(2) DEFAULT NULL COMMENT '性别(1.男  2.女)',
  `utype` int(4) DEFAULT NULL COMMENT '身份类型：1，普通会员；2，教练；3，队长；4，裁判',
  `trainer_level` int(4) DEFAULT NULL COMMENT '教练级别0：顶级教练，1：教练 2  vip用户可查看课件',
  `papers_pic` varchar(150) DEFAULT NULL COMMENT '证件图片',
  `province` varchar(36) DEFAULT NULL COMMENT '对应省份',
  `location` varchar(36) DEFAULT NULL COMMENT '用户所在地 区域',
  `position` varchar(20) DEFAULT NULL COMMENT '在团队中的位置，比如左边锋',
  `pic` varchar(200) DEFAULT NULL COMMENT '用户头像url',
  `micro_pic` varchar(150) DEFAULT NULL COMMENT '缩略图url',
  `description` varchar(2000) DEFAULT NULL COMMENT '自我介绍',
  `visible_stat` int(4) DEFAULT '0' COMMENT '是否可见（0：不可见，1：可见）',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '最新更新时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `audit` int(4) DEFAULT '0',
  `stat` int(4) NOT NULL DEFAULT '1' COMMENT '是否有效：1表示有效；0表示无效',
  `qq` varchar(100) DEFAULT NULL COMMENT 'QQ第三方登录ID',
  `weixin` varchar(100) DEFAULT NULL COMMENT '微信第三方登录ID                 ',
  `sina` varchar(100) DEFAULT NULL COMMENT '新浪第三方登录ID',
  `telephone` varchar(50) DEFAULT NULL COMMENT '座机号码',
  `postcode` varchar(6) DEFAULT NULL COMMENT '邮编',
  `detailed_address` varchar(500) DEFAULT NULL COMMENT '地址详情',
  `lecturer` int(4) DEFAULT '0' COMMENT '培训主讲人(0:不是;1:是培训主讲人)',
  `birthday` varchar(10) DEFAULT NULL COMMENT '生日',
  `team_id` varchar(36) DEFAULT NULL COMMENT '球队id',
  `area` varchar(36) DEFAULT NULL COMMENT '市',
  `qrcode` varchar(150) DEFAULT NULL COMMENT '二维码图片路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

