/*Table structure for table `sst_album_picture` */

DROP TABLE IF EXISTS `sst_album_picture`;

CREATE TABLE `sst_album_picture` (
  `id` varchar(36) NOT NULL DEFAULT '' COMMENT '主键',
  `menu_type` varchar(36) DEFAULT NULL COMMENT '菜单级别',
  `album_id` varchar(36) DEFAULT '' COMMENT '相册id',
  `pic` varchar(255) DEFAULT '' COMMENT '原图地址',
  `shadow_pic` varchar(255) DEFAULT NULL COMMENT '阴影图地址',
  `title` varchar(100) DEFAULT NULL COMMENT '中文标题',
  `en_title` varchar(100) DEFAULT NULL COMMENT '英文标题',
  `described` varchar(200) DEFAULT NULL COMMENT '相片描述',
  `en_describe` varchar(200) DEFAULT NULL COMMENT '相片描述-英文',
  `last_update_time` datetime DEFAULT NULL COMMENT '最近一次的更新时间',
  `create_time` datetime DEFAULT NULL COMMENT '记录的创建时间',
  `stat` int(4) NOT NULL DEFAULT '1' COMMENT '状态是否有效：1表示有效；0表示无效',
  `team_id` varchar(36) DEFAULT NULL COMMENT '图片所属球队id',
  `user_id` varchar(36) DEFAULT '' COMMENT '用户Id',
  `pic_status` int(4) DEFAULT '0' COMMENT '照片状态(0.待审核   1.审核通过 2.审核不通过)',
  `pic_type` int(4) DEFAULT NULL COMMENT '相片类型（4：教练员培训）',
  `order_no` int(4) DEFAULT NULL COMMENT '照片排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='相册图片';

