  `last_update_time` datetime DEFAULT NULL,
  `stat` int(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='赛事参加球队关联表';

