/*Table structure for table `sst_home_menu` */

DROP TABLE IF EXISTS `sst_home_menu`;

CREATE TABLE `sst_home_menu` (
  `id` varchar(50) NOT NULL COMMENT '主键',
  `parent_id` varchar(50) DEFAULT NULL,
  `cname` varchar(50) DEFAULT NULL,
  `ename` varchar(50) DEFAULT NULL,
  `menu_type` varchar(36) DEFAULT NULL,
  `menu_order` int(4) DEFAULT NULL,
  `menu_url` varchar(100) DEFAULT NULL,
  `content` text COMMENT '描述',
  `issingle` int(4) DEFAULT '0' COMMENT '显示类型（1：单页，2：图片轮播,3:图片列表,4:新闻资讯）',
  `last_update_time` datetime DEFAULT NULL,
  `create_time` date DEFAULT NULL,
  `stat` int(4) DEFAULT NULL,
  `summary` varchar(500) DEFAULT NULL,
  `picture` varchar(500) DEFAULT NULL,
  `activity_type` int(3) DEFAULT NULL,
  `video_type` int(3) DEFAULT NULL,
  `is_show` int(2) DEFAULT '1' COMMENT '首页是否显示(0:不显示;1:显示)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sst_home_menu` */

insert  into `sst_home_menu`(`id`,`parent_id`,`cname`,`ename`,`menu_type`,`menu_order`,`menu_url`,`content`,`issingle`,`last_update_time`,`create_time`,`stat`,`summary`,`picture`,`activity_type`,`video_type`,`is_show`) values ('037e8b7b-5add-476a-860f-52cfd5b6252c','671a3971-2e80-4481-86f8-3048201764f1','2222','22222','2',6,'','',2,'2016-04-28 10:50:44','2016-04-28',1,'','/upload/20160428/d14f9241f9fc41c5a6e011dbc998c7bc.jpg',NULL,NULL,0),('29ab349b-337d-4cdb-8a26-339d250708ad','2df6cf99-9083-4eed-b7df-79630bbc7417','中西式宴会','Chinese and Western banquets','2',1,'','',1,'2016-04-28 11:20:46','2016-04-07',0,'','',-1,-1,0),('2b106446-321a-4301-9297-e294cd01061c',NULL,'公司资质','company','1',4,'/company/index.htm','<div class=\"subtitle\">\r\n    企业简介<span class=\"curfont\">company overview</span>\r\n</div>\r\n<br>\r\n<p style=\"text-align: center;\">\r\n    &nbsp;2015年，JUJU PARTY外烩以业界最高规格的软硬件条件，拿下了餐饮行业内首张外烩服务资质许可证，成为上海乃至国内外餐饮服务品位升级的标志性事件。凭借众星捧月般的号召力，公司吸引了俏江南、绿波廊、绍兴饭店、lucedella vita等众多知名饭店，以及金茂君悦大酒店、上海世茂皇家艾美酒店等五星酒店品牌前来寻求合作，成为业界资源整合的集大成者。\r\n在过去三年间投入巨资，经过了多次大型改造，公司建成了6000多平方米冷链资质中央工厂，是一座具备先进的餐饮食品生产加工能力、现代化管理体系、标准化生产的冷链工厂。\r\n先进的冷链技术为外烩业务的研发、制作和供应提供了强大的保障。\r\n公司拥有国内最高规格的冷链物流体系，以及能对食品安全进行最优化控制的冷链管理平台系统。\r\nJUJU PARTY外烩旗下汇集了来自欧、美、东南亚、日本等地的国际化厨师、研发团队，欧美日韩原创菜式尽情挑拨您的舌尖，让你获得前所未有的饕餮享受。\r\n公司致力于打造从农场到餐桌(farm to table)的食品全产业链体系，品质可控，来源可追溯。全球化的采购供应链体系，确保了高端食材的原产、原汁、原味，采购标准比您的味蕾更苛刻。\r\n大型活动与小型PARTY领域的丰盛资源，使得我们公司成为上海高端外烩领域的上上之选。名门之秀，品味不凡。<br/>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    &nbsp;JuJu Party has attracted many famous in and out of our country because of its high-profiled soft and hard conditions, like South Beauty, Lvbo Lang, Shaoxing Hotel, Lucedella vita and other hotels including many well-known five-star hotels like Grand Hyatt as well as Le Royal Meridien Shanghai. It has become an industry resource of combination in this field.\r\nOur company has made a large investment and transformation to build a central factory of cold chin transport with more than 6,000 square meters. It is a modern factory with ability to produce and process food, manage with modern systems, make standard production.\r\n Advanced cold chain technology has provided a powerful guarantee for the R&amp;D about the cold chin transport systems and management for the food safety.\r\n The JuJu Party collected the international standard chefs from Europe, America, Japan and other areas of the world to make you feel the original enjoyment and get the unprecedented enjoyment that never have before.\r\nOur company is committed to build a food chin system from farm to table to ensure the quality of the food by controlling the whole process. The standard of selecting and purchasing the food are more restrict than your need.\r\nWe can also provide the gorgeous resource for the small or large parties and activities. Our company is the first choice for the high-standard activities in Shanghai with extraordinary taste and style.\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <img src=\"http://www.jujucatering.com/upload/20160428/53561461812427467.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/53561461812427467.jpg\"/>\r\n</p>',1,'2016-04-28 11:13:37','2016-04-06',1,'聚聚派对外烩（上海趴体外烩餐饮管理有限公司）拥有中国第一张外卖服务资质许可证和占地总面积超过6000平方米冷链资质食品研发中央工厂，是国内第一批获得冷链流通资质的企业。天坊食品研发中央工厂位于上海浦东航头，从传统盒饭作坊，到今天现代化管理体系、标准化生产的冷链工厂，经过了六次大型改造。聚聚派对外烩在大型活动与小型PARTY领域的丰富资源，成为上海高端外烩领域的上上之选，名门之秀，品味不凡。','/upload/20160406/fb2daa87a1c34161a5a1fbb40a2efbcc.jpg',-1,-1,1),('2b106446-321a-4301-9297-e294cd01061e','2b106446-321a-4301-9297-e294cd01061c','工厂介绍','factory','2',1,'','<div class=\"company_box factory\"><div class=\"subtitle\">工厂介绍<span class=\"curfont\">Factory</span></div><p style=\"text-align: center;\">上海天坊食品制造有限公司中央工厂位于上海浦东新区航头，工厂占地总面积6000多平方米，从2011年起不断投入巨资，使中央工厂从最初生产传统盒饭发展至今成为一个拥有独立产品研发团队、餐饮标准化工业生产体系，并在2015年获得上海首家团体膳食外卖资质证书的现代化新型餐饮生产加工企业。\r\n工厂生产的全部工作指令由独立开发的SAP系统进行处理。SAP系统是信息化管控的核心，确保产品生产在质量、计划、成本等方面高效运作，对食品安全可达到最优化控制。\r\n集团下属信息公司持续5年开发的产品形态、IMS系统、追溯系统、用户端APP等，为正在启动的团餐运营服务奠定了扎实基础。\r\n我们拥有一批优秀且专业的管理团队和工作团队，他们来自国内外著名餐饮企业。</p><p style=\"text-align: center;\">The central factory of Shanghai Tian Fang Food Co., Ltd is located in the Shanghai Pudong new area with 6,000 square meters. It has become a standard industrial production system with dependent product development team since traditional fast food in 2011, and won the first certificate of modern new-style of production and processing about community takeaway food in Shanghai.\r\nAll the orders about work at the factory are processed with independent SAP system. SAP is the core part of information controlling to make high efficiency in operation, planning, cost and other aspects of food safety.\r\nThe information company under the group has developed the products form for five years including IMS system, traceability system, APP for users and other things to lay a solid foundation for the operation and services of the group.\r\nWe have a number of outstanding and dedicated managed working teams and groups from foreign famous catering business.</p><p style=\"text-align: center;\"><img src=\"http://www.jujucatering.com/upload/20160428/57581461812390203.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/57581461812390203.jpg\"/></p></div>',1,'2016-04-28 10:59:53','2016-04-06',1,'','',-1,-1,1),('2b106446-321a-4301-9297-e294cd01061f','2b106446-321a-4301-9297-e294cd01061c','公司资质','Our Qualifications','2',2,'','<div class=\"company_box qualifications\"><div style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div><div class=\"subtitle\" style=\"text-align: center;\">公司资质<span class=\"curfont\">Our Qualifications</span>&nbsp; &nbsp; &nbsp;</div><p style=\"text-align: center;\">外卖餐饮服务许可证，是上海市食品药品监督管理局为整顿外烩服务市场、升级食品安全体系、提升上海国际中心城市餐饮服务水平而推出的一项认证。从冷链工厂硬件条件到软件条件都作出了极为严格的界定，聚聚派对外烩以国内外烩行业最高规格的软硬件条件而拔得头筹，拿下了国内第一张外卖服务资格许可证，成为上海乃至中国外烩服务品味升级的标志性事件。</p>\r\n			<p class=\"curfont\" style=\"text-align: center;\">Take-out catering service license is a certificate system released by Shanghai Food and Drug Administration(Shanghai FDA) to regulate catering service market, update food safety system and promote Shanghai’s catering service level as an international center. In this certification system, both hardware and software of cold-chain factory are strictly required. JujuCatering has obtained the first take-out catering service license in China with its most advanced software and hardware in both domestic and international catering industry, which has become the hallmark of catering service updating in Shanghai and even in China.</p>\r\n			<div class=\"imgbox company\" style=\"text-align: center;\"><img src=\"/img/company_2.jpg\" border=\"0\"/>\r\n &nbsp; &nbsp;</div>\r\n		</div>',1,'2016-04-28 11:21:53','2016-04-06',1,'','',-1,-1,1),('2b106446-321a-4301-9297-e294cd01061g','2b106446-321a-4301-9297-e294cd01061c','相关食品类认证','Relevant Certification','2',3,'','<div class=\"company_box certification\"><div class=\"subtitle\">相关食品类认证<span class=\"curfont\">Related food certificates</span></div><ul><li><div class=\"cont\"><h2>日产30000份冷链盒饭流通证</h2><br/><h3 class=\"curfont\">Certificate of distributing 30000 cold chain bentos per day</h3><br/></div></li><li><div class=\"cont\"><h2>团体膳食外卖服务许可证</h2><br/><h3 class=\"curfont\">License of take-out catering service for team food</h3><br/></div></li><li><div class=\"cont\"><h2>肉制品（酱卤肉制品）</h2><br/><h3 class=\"curfont\">Meat (sauced and spiced meat)</h3><br/></div></li><li><div class=\"cont\"><h2>非发酵性豆制品</h2><br/><h3 class=\"curfont\">Non-fermented bean products</h3><br/></div></li><li><div class=\"cont\"><h2>其他粮食加工品（谷物粉类制成品)</h2><br/><h3 class=\"curfont\">Other grain products</h3><br/></div></li><li><div class=\"cont\"><h2>方便食品</h2><br/><h3 class=\"curfont\">Instant food</h3></div></li></ul></div>',1,'2016-04-28 09:30:48','2016-04-06',1,'','',-1,-1,1),('2df6cf99-9083-4eed-b7df-79630bbc7417',NULL,'外烩服务','catering','1',3,'/catering/index.htm','<div class=\"subtitle\">外烩服务<span class=\"curfont\">Catering Service</span></div><p st