专业运营团队2天内现场服务超过16000人，各色精致美食搭配酷炫活动，推动嘉年华欢乐气氛到达顶峰！','/upload/20160406/d59a5b1a2d20498aad40d6365e74c54f.jpg',-1,-1,1),('502e343b-c4bc-4522-af54-2c0088c8b6af','502e343b-c4bc-4522-af54-2c0088c8b6ae','“风从东方来”娱乐影响力盛典，<br>聚聚派对外烩优异服务引众星喝彩！','The wind from the East','2',1,'','<h3>“风从东方来”娱乐影响力盛典，<br/>聚聚派对外烩优异服务引众星喝彩！</h3><p>\r\n					</p><h4 class=\"curfont\">The wind from the East&quot; entertainment influence Festival, <br/>poly party catering services cited excellent stars cheer!</h4><p style=\"text-align: center;\"><img src=\"http://www.jujucatering.com/upload/20160428/93261461808607374.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/93261461808607374.jpg\"/></p><p>2015年12月11日,聚聚派对外烩倾情打造了某大型公司毕马威饕餮之夜，本场活动为期两天，共有超过2500名毕马威员工参加了这场年度盛会。 针对这场年终盛会，聚聚派对外烩做了充足的准备，所有工作人员提前进场，协调前方活动，布置餐饮区域的搭建并且与毕马威紧密沟通，确保活动的万无一失。精心的菜品设计，精美的菜式摆盘专业的服务人员，都彰显着聚聚的实力。</p><p>\r\n					</p><p>On December 11, 2015, let&#39;s get together one of these foreign stewed dedecates road built a large firm KPMG dramatic night, this activity for two days, a total of more than 2500 KPMG employees attended the annual event. According to the annual event, let&#39;s get together one of these foreign stewed made adequate preparation, all staff in ahead of schedule, coordinate activities ahead, decorate building dining area and communicate closely with KPMG, to ensure foolproof. Elaborate dishes design, exquisite dishes plate professional service personnel, let&#39;s get together one of these has rushed in.</p>',1,'2016-04-28 09:58:37','2016-04-06',1,'聚聚派对外烩曾为','/upload/20160406/d59a5b1a2d20498aad40d6365e74c54f.jpg',-1,-1,1),('502e343b-c4bc-4522-af54-2c0088c8b6ag','502e343b-c4bc-4522-af54-2c0088c8b6ae','聚聚派对外烩与某大型公司年会','Together with a Large Firm party catering annual m','2',2,'','<h3>聚聚派对外烩与如新（中国）嘉年华</h3><p>&nbsp; &nbsp;					</p><h4 class=\"curfont\">JujuCatering Nu Skin(China) carnival</h4><p style=\"text-align: center;\">&nbsp; &nbsp;<img src=\"http://www.jujucatering.com/upload/20160428/67661461809182546.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/67661461809182546.jpg\"/>	</p><p>聚聚派对外烩荣幸成为如新（中国）万人大型嘉年华活动全程餐饮服务供应商。超过100人的专业运营团队2天内现场服务超过16000人，各色精致美食搭配酷炫活动，推动嘉年华欢乐气氛到达顶峰</p><p>&nbsp; &nbsp;					</p><p>Jujucatering was honored to be catering service supplier for the large carnival held by Nu Skin(China). Our professional operation team of over 200 persons service over 16000 guests. Various delicate and delicious dishes in combination with interesting activities pushed the carnival onto climax.</p>',1,'2016-04-28 10:07:10','2016-04-06',1,'聚聚派对外烩曾为','/upload/20160406/d59a5b1a2d20498aad40d6365e74c54f.jpg',-1,-1,1),('502e343b-c4bc-4522-af54-2c0088c8b6ah','502e343b-c4bc-4522-af54-2c0088c8b6ae','聚聚派对外烩与某大型公司年会','Together with a Large Firm party catering annual m','2',2,'','<h3>\r\n    聚聚派对外烩与上海浪琴环球马术冠军赛\r\n</h3>\r\n<p></p>\r\n<h4 class=\"curfont\">\r\n    JujuCatering and Shanghai longines global championship tour\r\n</h4>\r\n<p style=\"text-align: center;\">\r\n    &nbsp; &nbsp; &nbsp;<img src=\"http://www.jujucatering.com/upload/20160428/30991461809337138.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/30991461809337138.jpg\"/>\r\n</p>\r\n<p>\r\n    聚聚派对外烩与上海浪琴环球马术冠军赛联合牵手。外烩团队为马术冠军赛提供从工作人员到VIP嘉宾，从工作盒餐到西式餐宴的全线高端服务。由此成就聚聚派对外烩 的“华丽之跃”。\r\n</p>\r\n<p></p>\r\n<p>\r\n    JujuCatering has cooperated with Shanghai longines global championship tour by offering high end service from staff to VIP guest, from work food to western banquet, which has promoted the “beautiful leap” of JujuCatering.\r\n</p>',1,'2016-04-28 10:11:51','2016-04-06',1,'聚聚派对外烩曾为','/upload/20160406/d59a5b1a2d20498aad40d6365e74c54f.jpg',-1,-1,1),('534d03d5-0a83-4a73-b498-a9fd8dd52c05','29ab349b-337d-4cdb-8a26-339d250708ad','特色婚礼','wedding reception','2',2,'','',1,'2016-04-22 14:19:35','2016-04-22',1,'','',NULL,NULL,1),('536ff06e-7c9f-4cc4-a5da-5015c6b3e83f','671a3971-2e80-4481-86f8-3048201764f1','中式快餐','chinese','2',5,'','<p>11</p>',2,'2016-04-26 16:51:35','2016-04-26',0,'11','/upload/20160426/0a346960ac6a40129aef322dd4ee7014.jpg',NULL,NULL,1),('5e6ad2f2-f14a-4964-9598-1a78edf81628','671a3971-2e80-4481-86f8-3048201764f1','中式桌餐','Chinese Banquets','2',NULL,'','',2,'2016-04-26 16:26:24','2016-04-26',0,'','',NULL,NULL,1),('5fb99744-73b8-4c74-b115-40cd8cf111c5','502e343b-c4bc-4522-af54-2c0088c8b6ae','聚聚派对外烩与玛莎拉蒂','JujuCatering and Maserati','2',4,'','<h3>聚聚派对外烩与玛莎拉蒂</h3><p></p><h4 class=\"curfont\">JujuCatering and Maserati</h4><p style=\"text-align: center;\"><img src=\"http://www.jujucatering.com/upload/20160428/35971461809845898.jpg\" _src=\"http://www.jujucatering.com/upload/20160428/35971461809845898.jpg\"/></p><p>聚聚派对外烩与玛莎拉蒂牵手演绎赛道的激情与精致。聚聚团队临驾上海F1赛车场，为玛莎拉蒂尊贵VIP客户内部试驾体验活动提供自助餐。处处体现精心甄选与精细作派，无一不流露典雅高贵气派。</p><p></p><p>JujuCatering has showed the passion and delicacy of race circuit together with Maserati. JujuCatering team arrived at Shanghai F1 Circuit to offer banquet for the internal trial driving experience held by Maserati for its VIP customers. The ubiquitous selection and fineness has showed elegance and nobleness completely.</p>',1,'2016-04-28 10:17:30','2016-04-28',1,'','',NULL,NULL,NULL),('671a3971-2e80-4481-86f8-3048201764f1',NULL,'精选菜单','menu','1',2,'/menu/index.htm','<div class=\"subtitle\">精选菜单<span class=\"curfont\">Gourmet menu</span></div>\r\n<p style=\"text-align: center;\">\r\n    <br/>\r\n</p>\r\n<p></p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"font-size:16px;font-family:宋体\">我们的专业厨师团队</span> <span style=\"font-size:16px;font-family:宋体\">用精湛的厨艺</span> <span style=\"font-size:16px;font-family:宋体\">，在不断创新的同时</span> <span style=\"font-size:16px;font-family:宋体\">始终坚持保证食材的</span> <span style=\"font-size:16px;font-family:宋体\">最佳口感。宴会餐饮包括中西日餐、特聘国际五星级酒店行政总厨掌勺，精心烹饪，让您欣然享受极品美味。精心的菜品设计，精美的菜式摆盘，个性化的膳食营养搭配，营养更合理、饮食更安全、选择更丰富。</span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"font-size:16px;font-family:&#39;Times New Roman&#39;\">Our professional chef team boasts exquisite cooking skills. While keeping innovating, the chef team tries to keep the optimal taste of ingredients. Our banquets mainly offer Chinese, Western and Japanese food. The executive chefs once working in international five-star hotels are employed to prepare delicacies for your enjoyment. The exquisite dish design, the beautiful dish display and the personalized dietary nutrition match aim at giving more choices to you and making your diet more healthy and nutritious.&nbsp;</span>\r\n</p>\r\n<p></p>\r\n<p style=\"text-align: left;\">\r\n    <img src=\"http://www.jujucatering.com/upload/20160422/44921461313478203.jpg\" _src=\"http://www.jujucatering.com/upload/20160422/44921461313478203.jpg\"/>\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>',1,'2016-04-28 11:15:01','2016-04-06',1,'精心的菜品设计，精美的菜式摆盘，从工作盒餐到中西式餐宴。个性化的膳食营养搭配，营养更合理、饮食更安全、选择更丰富。','/upload/20160427/101ce07b24bf45ceb004127cba44a38d.jpg',-1,-1,1),('671a3971-2e80-4481-86f8-3048201764f2','671a3971-2e80-4481-86f8-3048201764f1','西式宴会菜单','West Package','2',5,'','',2,'2016-04-28 11:03:54','2016-04-06',1,'精心的菜品设计，精美的菜式摆盘，从工作盒餐到中西式餐宴。个性化的膳食营养搭配，营养更合理、饮食更安全、选择更丰富。','/upload/20160428/c02c51ec0dfc4b87a8a0dcc469bb8016.jpg',-1,-1,1),('671a3971-2e80-4481-86f8-3048201764f3','671a3971-2e80-4481-86f8-3048201764f1','茶歇菜单','Coffe & Tea','2',4,'','',2,'2016-04-28 11:03:51','2016-04-06',1,'精心的菜品设计，精美的菜式摆盘，从工作盒餐到中西式餐宴。个性化的膳食营养搭配，营养更合理、饮食更安全、选择更丰富。','/upload/20160428/5a95123599ea4fed801b58e454cafe77.jpg',-1,-1,1),('671a3971-2e80-4481-86f8-3048201764f4','671a3971-2e80-4481-86f8-3048201764f1','自助餐菜单','Buffet','2',1,'','',2,'2016-04-28 11:03:42','2016-04-06',1,'精心的菜品设计，精美的菜式摆盘，从工作盒餐到中西式餐宴。个性化的膳食营养搭配，营养更合理、饮食更安全、选择更丰富。','/upload/20160428/e603f3d38d6c48c5a4c275dad1efffc2.jpg',-1,-1,1),('8b2531c4-455a-4826-8b23-621079741325','29ab349b-337d-4cdb-8a26-339d250708ad','特色婚礼','wedding reception','2',NULL,'','',1,'2016-04-22 14:07:42','2016-04-22',1,'','',NULL,NULL,1),('8b40d84f-ebc6-4354-87e9-8491fc31c0c7','671a3971-2e80-4481-86f8-3048201764f1','中式菜单','Chinese Menu','2',3,'','',2,'2016-04-28 11:03:4