class=\"subtitle\">联系我们<span class=\"curfont\">Contact us</span></div><p>\r\n			</p><div class=\"imgbox\"><img src=\"/img/maps2.jpg\" border=\"0\"/></div><p>\r\n			</p><ul><li>\r\n				</li><li><label>客服热线：<span>Hotline:</span></label><p>400-622-6332</p></li><li>\r\n				</li><li><label>微信订阅号：<span>Wechat:</span></label><p>聚聚派对外烩(订阅号：jujuwaihui)<br/>在聚聚外烩餐饮官方微信留言<span>In poly catering catering official micro channel message together party catering (subscription number: jujuwaihui)</span></p></li><li>\r\n				</li><li><label>官方微博：<span>Sinaweibo:</span> </label><p>http://weibo.com/u/5449790562<br/>在聚聚派对官方微博留言<span>the poly party official microblogging message\r\n (http://weibo.com/u/5449790562)</span></p></li><li>\r\n			</li></ul>',1,'2016-04-27 11:13:11','2016-04-06',1,'','',-1,-1,1),('d493bf67-c8fc-4dfa-9835-3f4d443e5abe',NULL,'场地推荐','venue','1',6,'/venue/index.htm','<div class=\"subtitle\" style=\"text-align: center;\">场地推荐<span class=\"curfont\">Venue Recommendation</span></div><p style=\"text-align: center;\">&nbsp; &nbsp;</p><p><div style=\"text-align: center;\">我们可承接30-10000人规模的餐宴活动。无论是觥筹交错的盛大宴会，还是三两知己的温馨派对，我们都将为您精心奉上难以忘怀的美食和服务。</div><div style=\"text-align: center;\">专业的服务团队，拥有许多宴会经验，致力于提供最好最令人难忘的完美盛宴。我们可以迎合您的需要，提供各种设备以及宴会摆饰，并为专门的设计师为您制作各种宴会所需的小礼品以及卡片等。</div><div style=\"text-align: center;\">如果你还没有准备好足够的活动场地，我们总能找到适合您的理想场地。</div></p><p style=\"text-align: center;\">&nbsp; &nbsp;</p><p class=\"curfont\" style=\"text-align: center;\">We can provide banquet services to entertain 30~10,000 guests. Either in terms of large banquets or small gatherings among close friends, we will create an unforgettable experience for you with our delicacies and services. Our professional service team has rich banquet service experiences and is committed to creating banquets second to none. Our equipment and banquet layout are up to your requirement. Our designers can make various gifts and cards for different banquets. If you have not yet thought about the activity venue, we can try our best to find an ideal one for you.</p><p style=\"text-align: center;\">&nbsp; &nbsp;</p><div class=\"imgbox\"><p style=\"text-align: center;\"><img src=\"/img/venue.jpg\" border=\"0\"/></p><p style=\"text-align: center;\"><br/></p></div>',1,'2016-04-28 11:22:40','2016-04-06',1,'','/upload/20160406/72f0c3699788418e92abb73dbad0409c.jpg',-1,-1,1);

/*Table structure for table `sst_information` */

DROP TABLE IF EXISTS `sst_information`;

CREATE TABLE `sst_information` (
  `id` varchar(36) NOT NULL COMMENT '主键id',
  `menu_type` varchar(36) DEFAULT NULL COMMENT '菜单级别',
  `title` varchar(50) DEFAULT NULL COMMENT '标题-中文',
  `en_title` varchar(50) DEFAULT NULL COMMENT '标题-英文',
  `pic` varchar(200) DEFAULT NULL COMMENT '缩略图',
  `summary` varchar(200) DEFAULT NULL COMMENT '简介-中文',
  `en_summary` varchar(200) DEFAULT NULL COMMENT '简介-英文',
  `content` varchar(1000) DEFAULT NULL COMMENT '内容',
  `parent_type` int(1) NOT NULL DEFAULT '0' COMMENT '一级类型(0-新闻,1-健康食谱)',
  `sub_type` int(1) DEFAULT NULL COMMENT '二级类型(健康食谱:(0-常识,1-瘦身,2-食疗,3-实物归档,4-营养手册))',
  `create_admin_id` varchar(36) DEFAULT NULL COMMENT '创建者id',
  `create_admin_name` varchar(20) DEFAULT NULL COMMENT '创建者姓名',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `stat` int(1) NOT NULL DEFAULT '1' COMMENT '数据状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资讯(0-新闻,1-健康食谱)';

