/*Table structure for table `sst_video` */

DROP TABLE IF EXISTS `sst_video`;

CREATE TABLE `sst_video` (
  `id` varchar(36) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '主键',
  `game_id` varchar(36) CHARACTER SET utf8 DEFAULT NULL,
  `video_name` varchar(150) CHARACTER SET utf8 DEFAULT NULL COMMENT '视频名称',
  `video_thumb` varchar(150) CHARACTER SET utf8 DEFAULT NULL COMMENT '缩略图',
  `video` varchar(150) CHARACTER SET utf8 DEFAULT '' COMMENT '视频路径',
  `publish_people` varchar(150) CHARACTER SET utf8 DEFAULT '' COMMENT '发布人',
  `page_ranking` int(4) DEFAULT NULL COMMENT '前段排序',
  `team_id` varchar(36) CHARACTER SET utf8 DEFAULT NULL COMMENT '对应球队',
  `video_status` int(4) DEFAULT '0' COMMENT '视频状态(0.待审核   1.审核通过 2.审核不通过)',
  `user_id` varchar(36) CHARACTER SET utf8 DEFAULT '' COMMENT '用户Id',
  `marked` int(4) DEFAULT NULL COMMENT '是否加精',
  `video_type` int(4) DEFAULT NULL COMMENT '视频类型（1：happy football， 2:精英训练营，3：原创视频，4：教练员培训）',
  `described` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '视屏描述',
  `click_rate` int(10) DEFAULT '0' COMMENT '点击量',
  `browse_quantity` int(10) DEFAULT '0' COMMENT '浏览量',
  `last_update_time` datetime DEFAULT NULL COMMENT '最新更新时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `stat` int(4) DEFAULT '1' COMMENT '状态是否有效：1表示有效；0表示无效',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='视频';

